(self.webpackChunk=self.webpackChunk||[]).push([[147],{96:(e,a,o)=>{"use strict";o.r(a),o.d(a,{data:()=>s});const s={key:"v-18b94948",path:"/guide/command-listings.html",title:"Listado de comandos Nativescript",lang:"en-US",frontmatter:{},excerpt:"",headers:[{level:2,title:"Comandos generales",slug:"comandos-generales",children:[]},{level:2,title:"Verbos (comandos importantes)",slug:"verbos-comandos-importantes",children:[]},{level:2,title:"Plataformas soportadas",slug:"plataformas-soportadas",children:[]},{level:2,title:"Ambientes de trabajo",slug:"ambientes-de-trabajo",children:[]},{level:2,title:"Combinando las partes de un comando",slug:"combinando-las-partes-de-un-comando",children:[]},{level:2,title:"Modificadores",slug:"modificadores",children:[]}],filePathRelative:"guide/command-listings.md",git:{}}},329:(e,a,o)=>{"use strict";o.r(a),o.d(a,{default:()=>n});const s=(0,o(252).uE)('<h1 id="listado-de-comandos-nativescript" tabindex="-1"><a class="header-anchor" href="#listado-de-comandos-nativescript" aria-hidden="true">#</a> Listado de comandos Nativescript</h1><h2 id="comandos-generales" tabindex="-1"><a class="header-anchor" href="#comandos-generales" aria-hidden="true">#</a> Comandos generales</h2><ul><li>Verificar el correcto funcionamiento del entorno de desarrollo:</li></ul><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>ns doctor\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ul><li>Crear un proyecto desde cero:</li></ul><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>ns create <span class="token operator">&lt;</span>nombre_aplicación<span class="token operator">&gt;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ul><li>Realizar una limpieza del proyecto (borrar carpeta node_modules, platforms, hooks, etc):</li></ul><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>ns clean\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ul><li>Listar dispositivos disponibles:</li></ul><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>ns device\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ul><li>Listar dispositivos iOS disponibles en Mac:</li></ul><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>instruments -s\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h2 id="verbos-comandos-importantes" tabindex="-1"><a class="header-anchor" href="#verbos-comandos-importantes" aria-hidden="true">#</a> Verbos (comandos importantes)</h2><p>Existen tres comandos para compilar y/o ejecutar el proyecto, los llamaremos <strong>verbos</strong>. Los tres posibles verbos son:</p><ul><li><p><code>run</code>: Ejecuta la aplicación en la plataforma y ambiente proporcionados.</p></li><li><p><code>debug</code>: Ejecuta la aplicación en la plataforma y ambiente proporcionados en modo <strong>debugger</strong>, donde a través de <strong>ChromeDevTools</strong> permite analizar el tráfico de peticiones http, ver logs de consola, etc.</p></li><li><p><code>build</code>: Compila el proyecto nativo generando el archivo instalador según la plataforma y en el ambiente proporcionado en el comando.</p></li></ul><h2 id="plataformas-soportadas" tabindex="-1"><a class="header-anchor" href="#plataformas-soportadas" aria-hidden="true">#</a> Plataformas soportadas</h2><p>Para utilizar alguno de estos verbos se debe proporcionar para qué plataforma se debe ejecutar y opcionalmente el <strong>ambiente/entorno</strong>(<a href="">que veremos más adelante</a>) al que se quiere apuntar durante la ejecución. Los dos posibles valores de plataforma son:</p><ul><li><code>android</code></li><li><code>ios</code></li></ul><p>Podemos combinar los verbos con las posibles plataformas así:</p><ul><li><code>ns run android</code></li><li><code>ns debug android</code></li><li><code>ns build ios</code></li></ul><h2 id="ambientes-de-trabajo" tabindex="-1"><a class="header-anchor" href="#ambientes-de-trabajo" aria-hidden="true">#</a> Ambientes de trabajo</h2><p>Actualmente tenemos tres ambientes distintos con sus propios pool de usuarios, servicios y algunas configuraciones de acuerdo a las necesidades a medida que se desarrollan las nuevas funcionalidades. Estos ambientes son:</p><ul><li><p>Development (<strong>dev</strong>): Es el ambiente donde los desarrolladores <strong>Backend</strong> despliegan sus desarrollos nuevos antes de pasar a los analistas QA, puede estar un poco inestable pero permite a los desarrolladores Frontend integrar y consumir los nuevos servicios para ir ajustando las implementaciones hasta que puedan pasar al ambiente de pruebas.</p></li><li><p>Continuous integration / Pruebas (<strong>ci</strong>): Es el ambiente con la configuración lo más idéntica posible al ambiente de producción, ideal para que los <strong>QA</strong> realicen todas las pruebas funcionales que consideren pertinentes de las nuevas funcionalidades hechas en el ambiente de development, antes de dar su aprobación para que puedan pasar a producción.</p></li><li><p>Producción / Release (<strong>production o prod</strong>): Como su nombre lo indica, es el ambiente donde se encuentran todas las funcionalidades ya aprobadas por el equipo de QA y por ende ya están disponible para uso de los <strong>usuarios finales</strong>.</p></li></ul><p>Estos ambientes son establecidos en los comandos a través del uso del modificador <code>--env</code>, el cual detallaremos más en el apartado de <a href="">modificadores</a> que veremos más adelante.</p><h2 id="combinando-las-partes-de-un-comando" tabindex="-1"><a class="header-anchor" href="#combinando-las-partes-de-un-comando" aria-hidden="true">#</a> Combinando las partes de un comando</h2><p>Ahora con todas las partes importantes de la estructura de nuestros comandos claros, podemos combinarlos para ejecutar el verbo que queramos, de la plataforma deseada, en un ambiente definido. Se debe organizar en el siguiente orden específico:</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>ns <span class="token operator">&lt;</span>verbo<span class="token operator">&gt;</span> <span class="token operator">&lt;</span>platform<span class="token operator">&gt;</span> --env.<span class="token operator">&lt;</span>environment<span class="token operator">&gt;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>Es decir que podríamos ejecutar algunos comandos como:</p><ul><li>Compilar la aplicación para un dispositivo android apuntando al ambiente de desarrollo:</li></ul><p><code>ns build android --env.development</code> ó ns <code>build android --env.dev</code> ó simplemente <code>ns build android</code></p><ul><li><p>Debuggear la aplicación en un dispositivo iOS apuntando al ambiente de pruebas: <code>ns build ios --env.ci</code></p></li><li><p>Correr la aplicación en un dispositivo Android apuntando al ambiente de producción (release):</p></li></ul><p><code>ns run android --env.production</code> ó <code>ns run android --env.prod</code></p><div class="custom-container warning"><p class="custom-container-title">NOTA:</p><p>Cuando no se establece un ambiente, se selecciona el de development (dev) por defecto.</p></div><h2 id="modificadores" tabindex="-1"><a class="header-anchor" href="#modificadores" aria-hidden="true">#</a> Modificadores</h2><p>Al igual que cualquier interfaz de línea de comandos (CLI), existen varios modificadores que a través de banderas escritas en los comandos, permiten modificar la ejecución para realizar tareas y cosas específicas. Estos son los más importantes que algunas veces utilizamos, algunos son específicos por plataforma:</p><div class="custom-container warning"><p class="custom-container-title">NOTA:</p><p>A los modificadores se le anteponen dos signos de guión (--) como vimos en los ejemplos anteriores.</p></div><table><thead><tr><th>Modificador</th><th>Plataforma</th><th>Descripción</th></tr></thead><tbody><tr><td><code>--emulator</code></td><td>ambas</td><td>Da prioridad al emulador de la plataforma indicada cuando también hay dispositivos físicos conectados.</td></tr><tr><td><code>--no-hmr</code></td><td>ambas</td><td>Desactiva la función de HotModuleReload de webpack.</td></tr><tr><td><code>--clean</code></td><td>ambas</td><td>Forza una limpieza del proyecto antes de ejecutar el comnado.</td></tr><tr><td><code>--inspector</code></td><td>IOS</td><td>Utiliza Webkit Web Inspector debugger (Safari) en vez de ChromeDevTools que es el que se usa por defecto.</td></tr><tr><td><code>--device &lt;ID del device&gt;</code></td><td>ambas</td><td>Utiliza el dispositivo del identificador único proporcionado</td></tr><tr><td><code>--for-device</code></td><td>IOS</td><td>Genera el proyecto nativo para un dispositivo físico (que tiene distinta estructura al de emulador). Genera el archivo .ipa para distribuir de manera alternativa.</td></tr><tr><td><code>--env.development o --env.dev</code></td><td>ambas</td><td>Establece <strong>desarrollo</strong> como el ambiente de trabajo</td></tr><tr><td><code>--env.ci</code></td><td>ambas</td><td>Establece <strong>ci</strong> como el ambiente de trabajo</td></tr><tr><td><code>--env.production ó --env.prod</code></td><td>ambas</td><td>Establece <strong>producción</strong> como el ambiente de trabajo</td></tr><tr><td><code>--env.dropConsole</code></td><td>ambas</td><td>Elimina los mensajes de consola utilizados en el proyecto (console.log, console.dir, etc.)</td></tr><tr><td><code>--env.forceDebug</code></td><td>ambas</td><td>Forza a escribir siempre los logs en consola, ya que cuando se compila a producción, se suprimen los logs por defecto.</td></tr></tbody></table>',37),n={render:function(e,a){return s}}}}]);